} fn main() { outer::public();
} Use the pub keyword to make modules public. Additionally, there are advanced pub(...) specifiers to restrict the scope of public visibility. See the Rust Reference . Configuring pub(crate) visibility is a common pattern. Less commonly, you can give visibility to a specific path. In any case, visibility must be granted to an ancestor module (and all of its descendants).

