The zerocopy crate (from Fuchsia) provides traits and macros for safely converting between byte sequences and other types. use zerocopy::AsBytes; #[repr(u32)]
#[derive(AsBytes, Debug, Default)]
enum RequestType { #[default] In = 0, Out = 1, Flush = 4,
} #[repr(C)]
#[derive(AsBytes, Debug, Default)]
struct VirtioBlockRequest { request_type: RequestType, reserved: u32, sector: u64,
} fn main() { let request = VirtioBlockRequest { request_type: RequestType::Flush, sector: 42, ..Default::default() }; assert_eq!( request.as_bytes(), &[4, 0, 0, 0, 0, 0, 0, 0, 42, 0, 0, 0, 0, 0, 0, 0] );
} This is not suitable for MMIO (as it doesn't use volatile reads and writes), but can be useful for working with structures shared with hardware e.g. by DMA, or sent over some external interface. FromBytes can be implemented for types for which any byte pattern is valid, and so can safely be converted from an untrusted sequence of bytes. Attempting to derive FromBytes for these types would fail, because RequestType doesn't use all possible u32 values as discriminants, so not all byte patterns are valid. zerocopy::byteorder has types for byte-order aware numeric primitives. Run the example with cargo run under src/bare-metal/useful-crates/zerocopy-example/. (It won't run in the Playground because of the crate dependency.)

